import Vue from "vue";
import VueRouter from "vue-router";

import AppMain from "../views/AppMain.vue";
import AppLogin from "../views/AppLogin.vue";
import AppBoard from "../views/AppBoard.vue";
import AppMap from "../views/AppMap.vue";
import AppAssistance from "../views/AppAssistance.vue";
import HouseDetail from "../components/map/HouseDetail.vue";
import HouseList from "../components/map/HouseList.vue";
import HouseMap from "../components/map/HouseMap.vue";
import MemberSignUp from "../components/user/MemberSignUp.vue";
import HouseListParent from "../components/map/HouseListParent.vue";
import HouseSearchBar from "../components/map/HouseSearchBar.vue";

import BoardDetail from "../components/board/BoardDetail.vue";
import BoardWrite from "../components/board/BoardWrite.vue";
// import BoardList from "../components/board/BoardList.vue";

Vue.use(VueRouter);

const routes = [
  {
    path: "/",
    name: "main",
    component: AppMain,
  },
  {
    path: "/login",
    name: "login",
    component: AppLogin,
  },
  {
    path: "/signup",
    name: "signup",
    component: MemberSignUp,
  },
  {
    path: "/board",
    name: "board",
    component: AppBoard,
    // children: [
    //   {
    //     path: "list",
    //     name: "boardList",
    //     component: BoardList,
    //     children: [
    //       {
    //         path: "write",
    //         name: "boardWrite",
    //         component: BoardWrite,
    //       },
    //       {
    //         path: "detail/:bno",
    //         name: "boardDetail",
    //         component: BoardDetail,
    //       },
    //     ],
    //   },
    // ],
  },
  {
    path: "/board/write",
    name: "boardWrite",
    component: BoardWrite,
  },
  {
    path: "/board/detail/:bno",
    name: "boardDetail",
    component: BoardDetail,
  },
  {
    path: "/map",
    name: "map",
    component: AppMap,
    children: [
      {
        path: "hmap",
        name: "hmap",
        component: HouseMap,
      },
      {
        path: "hlistp",
        name: "hlistp",
        component: HouseListParent,
        children: [
          {
            path: "hlist",
            name: "hlist",
            component: HouseList,
          },
          {
            path: "hdetail",
            name: "hdetail",
            component: HouseDetail,
          },
          {
            path: "hsearchbar",
            name: "hsearchbar",
            component: HouseSearchBar,
          },
        ],
      },
    ],
  },
  {
    path: "/assist",
    name: "assist",
    component: AppAssistance,
  },
];

const router = new VueRouter({
  mode: "history",
  base: process.env.BASE_URL,
  routes,
});

export default router;
